INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 7001, "キャル", 1, -363.0, 7, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 7002, "コッコロ", 1, -363.0, 7, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 7003, "ペコリーヌ", 1, -363.0, 7, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 10001, "ペコリーヌ", 1, -363.0, 10, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 10002, "キャル", 1, -363.0, 10, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 10003, "コッコロ", 1, -363.0, 10, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, 10004, "シェフィ", 2, -363.0, 10, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 12001, "ペコリーヌ", 1, -416.5, 12, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 13001, "キャル", 1, -363.0, 13, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 13002, "コッコロ", 1, -363.0, 13, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, 13003, "シェフィ", 2, -363.0, 13, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 13004, "ペコリーヌ", 1, -363.0, 13, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 14001, "コッコロ", 1, -363.0, 14, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, 14002, "シェフィ", 2, -363.0, 14, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 14003, "ペコリーヌ", 1, -363.0, 14, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 14004, "キャル", 1, -363.0, 14, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 15001, "コッコロ", 1, -470.0, 15, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, 16001, "シェフィ", 2, -363.0, 16, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 16002, "ペコリーヌ", 1, -363.0, 16, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 16003, "キャル", 1, -363.0, 16, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 16004, "コッコロ", 1, -363.0, 16, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 17002, "コッコロ", 1, -363.0, 17, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 17004, "キャル", 1, -363.0, 25, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 17005, "コッコロ", 1, -363.0, 25, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 1, 17006, "シェフィ", 2, -363.0, 25, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 17007, "ペコリーヌ", 1, -363.0, 25, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 18001, "カリン", 1, -363.0, 18, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 2, 18002, "カリン", 1, -363.0, 18, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 3, 19001, "カリン", 1, -470.0, 19, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 4, 19002, "カリン", 1, -470.0, 19, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 5, 20001, "カリン", 1, -470.0, 20, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 6, 20002, "カリン", 1, -470.0, 20, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 21001, "キャル", 1, -363.0, 21, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 21002, "コッコロ", 1, -363.0, 21, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, 21003, "シェフィ", 2, -363.0, 21, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 21004, "ペコリーヌ", 1, -363.0, 21, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 22001, "カリン", 1, -430.0, 22, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 2, 22002, "カリン", 1, -430.0, 22, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 3, 23001, "カリン", 1, -430.0, 23, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 4, 23002, "カリン", 1, -430.0, 23, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 24001, "エリコ（バレンタイン）", 1, -385.0, 24, 109001, 10011, 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 4.08);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 24002, "エリコ（バレンタイン）", 1, -385.0, 24, 109001, 10011, 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 5.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 3, 24003, "エリコ（バレンタイン）", 1, -385.0, 24, 109001, 10011, 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10.11);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4, 24004, "エリコ（バレンタイン）", 1, -385.0, 24, 109001, 10011, 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 4.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 5, 24005, "エリコ（バレンタイン）", 1, -385.0, 24, 109001, 10011, 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 6.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, 24006, "エリコ（バレンタイン）", 1, 0.0, 24, 109002, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 7, 24007, "エリコ（バレンタイン）", 1, 0.0, 24, 109002, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 8, 24008, "エリコ（バレンタイン）", 1, 0.0, 24, 109002, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 9, 24009, "エリコ（バレンタイン）", 1, 0.0, 24, 109002, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10, 24010, "エリコ（バレンタイン）", 1, 0.0, 24, 109002, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 24011, "シズル（バレンタイン）", 1, -385.0, 24, 109101, 10011, 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 2.12);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 24012, "シズル（バレンタイン）", 5, -385.0, 24, 109101, 10011, 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 4.19);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 3, 24013, "シズル（バレンタイン）", 2, -385.0, 24, 109101, 10011, 4, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 2.3);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 4, 24014, "シズル（バレンタイン）", 1, 0.0, 24, 109102, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 24015, "シズル（バレンタイン）", 5, -385.0, 24, 109101, 10011, 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 5.23);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 6, 24016, "シズル（バレンタイン）", 1, 0.0, 24, 109102, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 8.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 7, 24017, "シズル（バレンタイン）", 1, -385.0, 24, 109101, 10011, 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 5.01);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 8, 24018, "シズル（バレンタイン）", 1, 0.0, 24, 109102, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 9, 24019, "シズル（バレンタイン）", 1, 0.0, 24, 109102, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 10, 24020, "シズル（バレンタイン）", 1, 0.0, 24, 109102, 10011, 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 1, 26001, "シェフィ", 2, -363.0, 26, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, 26002, "ペコリーヌ", 1, -363.0, 26, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 1, 26003, "キャル", 1, -363.0, 26, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, 26004, "コッコロ", 1, -363.0, 26, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 1, 27001, "シェフィ", 2, -363.0, 27, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, 27002, "ペコリーヌ", 1, -363.0, 27, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 1, 27003, "キャル", 1, -363.0, 27, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 1, 27004, "コッコロ", 1, -363.0, 27, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 1, 28001, "カリン", 1, -363.0, 28, 190801, 0, 1, "2019/09/24 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 2, 28002, "カリン", 1, -363.0, 28, 190801, 0, 1, "2019/09/24 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 3, 29001, "カリン", 1, -409.0, 29, 190801, 0, 1, "2019/09/24 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 4, 29002, "カリン", 1, -409.0, 29, 190801, 0, 1, "2019/09/24 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 5, 30001, "カリン", 1, -409.0, 30, 190801, 0, 1, "2019/09/24 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 6, 30002, "カリン", 1, -409.0, 30, 190801, 0, 1, "2019/09/24 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 7, 31001, "カリン", 1, -409.0, 31, 190801, 0, 1, "2019/10/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 8, 31002, "カリン", 1, -409.0, 31, 190801, 0, 1, "2019/10/31 12:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 1, 32001, "カリン", 1, -409.0, 32, 190801, 0, 1, "2019/12/20 5:00:00", "2020/01/04 4:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 2, 32002, "カリン", 1, -409.0, 32, 190801, 0, 1, "2019/12/20 5:00:00", "2020/01/04 4:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 3, 33001, "カリン", 1, -409.0, 33, 190801, 0, 1, "2019/12/20 5:00:00", "2020/01/04 4:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 4, 33002, "カリン", 1, -409.0, 33, 190801, 0, 1, "2019/12/20 5:00:00", "2020/01/04 4:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 5, 34001, "カリン", 1, -409.0, 34, 190801, 0, 1, "2020/01/04 5:00:00", "2020/01/10 11:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 6, 34002, "カリン", 1, -409.0, 34, 190801, 0, 1, "2020/01/04 5:00:00", "2020/01/10 11:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 1, 38001, "ペコリーヌ", 1, -458.0, 38, 105801, 0, 2, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 5.3);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 2, 38002, "ペコリーヌ", 1, -458.0, 38, 105801, 0, 2, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 6.5);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 9999.0, "", 0, 39005, "ペコリーヌ", 3, 9999.0, 39, 105801, 0, 3, "2020/04/01", "2020/04/08 23:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 2, 40001, "カリン", 1, -430.0, 40, 190801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 1, 41001, "シェフィ", 1, -363.0, 41, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 1, 41002, "ペコリーヌ", 1, -363.0, 41, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 1, 41003, "キャル", 1, -363.0, 41, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 1, 41004, "コッコロ", 1, -363.0, 41, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 1, 42001, "コッコロ", 1, -416.5, 42, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2104010, 0.0, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 1, 42002, "シェフィ", 1, -416.5, 42, 106401, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 1, 42003, "ペコリーヌ", 1, -416.5, 42, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 1, 42004, "キャル", 1, -416.5, 42, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 1, 43001, "ペコリーヌ", 1, -363.0, 43, 105801, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 1, 43002, "コッコロ", 1, -363.0, 43, 105901, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, 43003, "キャル", 1, -363.0, 43, 106001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 1, 43004, "アメス", 1, -416.5, 44, 123001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 2, 43005, "アメス", 1, -416.5, 44, 123001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 3, 43006, "アメス", 1, -416.5, 45, 123001, 0, 2, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 5.79);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 1, 46001, "アメス", 1, -371.5, 46, 123001, 0, 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 1, 47001, "シズル", 2, -416.5, 47, 104901, 0, 2, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 0.0, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 1, 47002, "リノ", 1, -416.5, 47, 101101, 0, 2, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 9.32);
